    "2015-12-20T19:01:28.614590",nt"name": "2014-mobile-county-al-lidar",nt"isopen":
    false,nt"url": null,nt"notes": "Atlantic was contracted to acquire high
    resolution topographic LiDAR (Light Detection and Ranging) data located in Mobile
    County, Alabama. The intent was to collect one (1) Area of Interest (AOI) that encompasses
    Mobile County. The total client defined AOI was 1,402 square miles or 3,361 square
    kilometers. The data were collected from January 12 - 22, 2014. Classifications
    of data available from NOAA OCM are: 1 (Unclassified, 2 (Ground), 3 (Low Vegetation),
    7 (Low Noise), 8 (Model Key Points), 9 (Water), 10 (Ignored Ground, Breakline Proximity).
    Low vegetation points were removed as they were incorrect and not required for delivery.
    Digital Elevation Models (DEMs) created from this las data are available for download.
    They are available at: ftp://ftp.coast.noaa.gov/pub/DigitalCoast/lidar1_z/geoid12b/data/4966/supplemental/dems
    Breaklines created from this las data are also available for download. They are
    available at: ftp://ftp.coast.noaa.gov/pub/DigitalCoast/lidar1_z/geoid12b/data/4966/supplemental/breaklines",nt"license_title":
